import { Header } from '../Main/BasketPage/components/Header';

export default {

  title: 'Header',
  component: Header,
  argTypes: {
    names: { control: 'array' },
    namesForLargeScreeen: { control: 'array' },
  },
};

function Template(args) {
  // eslint-disable-next-line react/jsx-props-no-spreading
  return <Header {...args} />;
}

export const Default = Template.bind({});
